import React from 'react';
import './index.scss'

class Navbar extends React.Component {

    render() {
        return (
            <nav>
                <div className='logo'>
                    <h1>APP</h1>                                
                </div>
                <button>
                    <span/>
                    <span/>
                </button>
            </nav>
        )
    }

}

export default Navbar;
